import React from 'react';
import './Signin.css'

export default class UserCreated extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div id="wrapper">
        <form id="login">
        <h2>Utilisateur créé! En attente de validation. </h2>
        <p></p>
        </form>
      </div>
    );
  }
}
